INSERT INTO `bot` VALUES (50,'inicio_atendimento','Olá em que posso ajuda-lo?\r\n','1','2020-10-22 18:54:37',9,NULL,'texto'),(51,'menu_principal','escolha 1','2','2020-10-22 18:54:37',9,NULL,'texto'),(52,'menu_invalido','inválido escolha 1','3','2020-10-22 18:54:37',9,NULL,'texto'),(53,'fim_atendimento','fim do atendimento','5','2020-10-22 18:54:37',9,NULL,'texto'),(62,'inicio_atendimento','Obrigado por entrar em contato.\r\nPor favor, me diga seu nome.','1','2020-10-23 16:16:38',3,NULL,'texto'),(63,'menu_principal','Escolha uma das opções abaixo:\r\n\r\n1 - Conheça nosso aplicativo de envios\r\n2 - Agende uma apresentação do aplicativo\r\n3 - Quer contratar agora!\r\n\r\nDigite a qualquer momento *SAIR* para finalizar o atendimento','2','2020-10-23 16:16:38',3,NULL,'texto'),(64,'menu_invalido','Você digitou uma opção inválida.\r\n\r\nEscolha uma das opções abaixo:\r\n1 - Conheça nosso aplicativo de envios\r\n2 - Agenda uma apresentação do aplicativo\r\n3 - Veja nosso vídeo com a apresentação','3','2020-10-23 16:16:38',3,NULL,'texto'),(65,'fim_atendimento','Seu atendimento foi finalizado. Obrigado por entrar em contato. ','5','2020-10-23 16:16:38',3,NULL,'texto'),(66,'1','Acesse nosso site www.mediconsulting.com.br','4','2020-10-23 16:17:03',3,'/uploads/1603926805178logoGarage.jpg','imagem'),(67,'2','Nossos consultores entrarão em contato com você dentro de instantes. Obrigado!','4','2020-10-23 16:17:29',3,'','texto'),(70,'1','teste','4','2020-10-23 18:25:14',9,'/uploads/1603477514160Seleção_050.png','imagem'),(71,'3','Clique no link abaixo e fala contato com um consultor:\r\n\r\nhttps://wa.me/5531985294349','4','2020-10-26 11:51:06',3,'','texto'),(72,'inicio_atendimento','Olá! Tudo bem?\r\n\r\nComo posso lhe ajudar?','1','2020-10-28 19:36:35',15,NULL,'texto'),(73,'menu_principal','Ótimo!\r\n\r\nVou lhe enviar algumas opções:\r\n1. Falar com um atendente\r\n2. Visitar o nosso site\r\n3. Seguir nossas redes sociais\r\n4. Acessar nossos materiais gratuitos\r\n\r\nA qualquer momento digite a palavra SAIR para encerrar esta conversa.','2','2020-10-28 19:36:35',15,NULL,'texto'),(74,'menu_invalido','Não consegui entender a sua solicitação.\r\nVou enviar as opções novamente:\r\n\r\n1. Falar com um atendente\r\n2. Visitar o nosso site\r\n3. Seguir nossas redes sociais\r\n4. Acessar nossos materiais gratuitos\r\n\r\nA qualquer momento digite a palavra SAIR para encerrar esta conversa.','3','2020-10-28 19:36:35',15,NULL,'texto'),(75,'fim_atendimento','Obrigado pelo seu contato!','5','2020-10-28 19:36:35',15,NULL,'texto'),(76,'1','WhatsApp Atendimento: https://api.whatsapp.com/send?phone=5521994194621\r\n\r\nA qualquer momento digite a palavra SAIR para encerrar esta conversa.','4','2020-10-28 19:37:59',15,'','texto'),(77,'2','Site: https://www.primeoptical.com.br/\r\n\r\nA qualquer momento digite a palavra SAIR para encerrar esta conversa.','4','2020-10-28 19:38:48',15,'','texto'),(78,'3','Facebook: https://www.facebook.com/laboratorioprimeoptical/\r\nInstagram: https://www.instagram.com/labprimeoptical/\r\nLinkedIn: https://www.linkedin.com/company/laboratorio-prime-optical/\r\n\r\nA qualquer momento digite a palavra SAIR para encerrar esta conversa.','4','2020-10-28 19:40:35',15,'','texto'),(79,'4','Materiais gratuitos: https://linktr.ee/labprimeoptical\r\n\r\nA qualquer momento digite a palavra SAIR para encerrar esta conversa.','4','2020-10-28 19:41:01',15,'','texto'),(80,'inicio_atendimento','Olá, tudo bem? Agradecemos seu contato! Esse canal é exclusivo para pedidos.\r\n*Me diga seu nome por favor.*','1','2020-11-09 12:45:04',16,NULL,'texto'),(81,'menu_principal','Obrigado. Agora apresentarei a você algumas opções para prosseguir com seu pedido. Lembrando que sou um robô e é importante você seguir nosso menu.\r\n\r\nDigite o número referente a sua solicitação:\r\n\r\n1 - Ver Cardápio\r\n2 - Fazer Pedido\r\n3 - Entrar em contato com um atendente\r\n4 - Visitar nossas lojas\r\n\r\nDigite *Sair* a qualquer momento para finalizar.','2','2020-11-09 12:45:04',16,NULL,'texto'),(82,'menu_invalido','Ok. Recebemos sua solicitação. \r\n\r\nCaso ainda queira interagir comigo, digite *menu* que passarei as opções disponíveis.\r\nCaso queira finalizar digite *SAIR*. \r\n\r\n*O tempo de entrega é de aproximadamenteo 40 minutos.*\r\n\r\nObrigado!!!!!','3','2020-11-09 12:45:04',16,NULL,'texto'),(83,'fim_atendimento','Agradecemos seu contato. Volte sempre.','5','2020-11-09 12:45:04',16,NULL,'texto'),(84,'1','Segue nosso cardápio. \r\nPara fazer o pedido. \r\n\r\n*Digite o número do produto.*','4','2020-11-09 12:48:28',16,'/uploads/1604939505326FLIPPER-Cardápio-02.jpg','imagem'),(85,'140','Esse é pra quem está na dieta rsrsrs!!! Muiito bom!\r\n\r\n140 - Hambúrguer e queijo - O valor dele é _*R$ 15,50*_\r\n\r\nMe fala seu *endereço de entrega* e qual será a *forma de pagamento* por favor.\r\nSe for em dinheiro, já me fala se *vai precisar de troco ok?*\r\n\r\nLembrando, digite tudo junto (endereço, forma de pagamento e troco) de uma vez que facilita ok?','4','2020-11-09 13:38:38',16,'','texto'),(86,'menu','Que bom que voltou!!!!\r\n\r\nDigite o número referente a sua solicitação:\r\n\r\n1 - Ver Cardápio\r\n2 - Fazer Pedido\r\n3 - Entrar em contato com um atendente\r\n4 - Visitar nossas lojas\r\n\r\nDigite *Sair* a qualquer momento para finalizar.','4','2020-11-09 16:12:11',16,'','texto'),(87,'2','Obaaaa! Teremos pedido!!!\r\n\r\nFaz assim, segue acima nosso cardápio. \r\nPara fazer o pedido. \r\n*Digite o número do produto referente ao produto pretendido.*','4','2020-11-09 16:14:40',16,'/uploads/1604945385750FLIPPER-Cardápio-02.jpg','imagem'),(88,'3','Ok. Aguarde um minutinho que já te chamo!\r\n\r\nEnquanto isso, queria ter dizer que temos açaí com vários complementos. \r\nSe o antendimento demorar, me chama nesse número aqui https://wa.me/5531985294349.\r\nSó clicar e conversamos.','4','2020-11-09 16:16:49',16,'','texto'),(89,'4','Que Bom que você quer conhecer nossas lojas.\r\n\r\nAnota os endereços ai?\r\n\r\n*Flipper Lanches SP*\r\nR. Henrique Savi, 12-40 - Vila Nova Cidade Universitaria, Bauru - SP, 17012-205\r\n\r\n*Flipper Lanches BH*\r\nR. dos Goitacases, 1920 - Centro - Belo Horizonte - MG, 310290-090','4','2020-11-09 16:19:25',16,'','texto'),(90,'145','Acho que tudo na vida tinha que ter Baconnnnnn!!!! Esse é muito bom!!!\r\n\r\n145 - 06 - X-bacon - Hamburguer, queijo, bacon, alface e tomate.\r\nO valor dele é _*R$ 18,90.*_\r\n\r\nMe fala seu *endereço de entrega* e qual será a *forma de pagamento* por favor.\r\nSe for em dinheiro, já me fala se *vai precisar de troco ok?*\r\n\r\nLembrando, digite tudo junto (endereço, forma de pagamento e troco) de uma vez que facilita ok?','4','2020-11-09 16:23:29',16,'','texto'),(91,'inicio_atendimento','Olá, \r\nEsta mensagem é automática, mas podemos ajudar em algumas questões.\r\nResponda colocando somente o número da pergunta abaixo que deseja resposta. No caso de alguma dúvida ou questão mais especifica, entre em contato no Hospital (19) 3437-5353.\r\n\r\n*Digite seu nome* para que possa prosseguir com seu atendimento:','1','2020-11-16 17:14:35',18,NULL,'texto'),(92,'menu_principal','Como eu posso te ajudar? Digite o número referênte a sua solicitação:\r\n\r\n1 - Agendamento de consultas por telefone \r\n2 - Agendamento de consultas pelo site \r\n3 - Localização do Hospital de Olhos Piracicaba \r\n4 - Agendamento de cirurgias / dúvidas sobre cirurgias \r\n5 - Agendamento de exames / dúvidas sobre exames oftalmológicos \r\n6 -  Nossos Médicos: \r\n7 -  Nossos convênios / Particular \r\n\r\nSair - Encerrar o atendimento\r\nMenu principal -Retornar ao menu principal','2','2020-11-16 17:14:35',18,NULL,'texto'),(93,'menu_invalido','Não consegui entender o que você solicitou.\r\n\r\nVamos tentar novamente? Digite o número referênte a sua solicitação:\r\n\r\n1 - Agendamento de consultas por telefone \r\n2 - Agendamento de consultas pelo site \r\n3 - Localização do Hospital de Olhos Piracicaba \r\n4 - Agendamento de cirurgias / dúvidas sobre cirurgias \r\n5 - Agendamento de exames / dúvidas sobre exames oftalmológicos \r\n6 -  Nossos Médicos: \r\n7 -  Nossos convênios / Particular \r\n\r\nSair - Encerrar o atendimento\r\nMenu principal - Retornar ao menu principal','3','2020-11-16 17:14:35',18,NULL,'texto'),(94,'fim_atendimento','Obrigado por utilizar nossos, volte sempre! ','5','2020-11-16 17:14:35',18,NULL,'texto'),(95,'menu principal','Como eu posso te ajudar? Digite o número referênte a sua solicitação:\r\n\r\n1 - Agendamento de consultas por telefone \r\n2 - Agendamento de consultas pelo site \r\n3 - Localização do Hospital de Olhos Piracicaba \r\n4 - Agendamento de cirurgias / dúvidas sobre cirurgias \r\n5 - Agendamento de exames / dúvidas sobre exames oftalmológicos \r\n6 -  Nossos Médicos: \r\n7 -  Nossos convênios / Particular \r\n\r\nSair - Encerrar o atendimento\r\nMenu principal -Retornar ao menu principal','4','2020-11-16 17:19:23',18,'','texto'),(96,'menu','Como eu posso te ajudar? Digite o número referênte a sua solicitação:\r\n\r\n1 - Agendamento de consultas por telefone \r\n2 - Agendamento de consultas pelo site \r\n3 - Localização do Hospital de Olhos Piracicaba \r\n4 - Agendamento de cirurgias / dúvidas sobre cirurgias \r\n5 - Agendamento de exames / dúvidas sobre exames oftalmológicos \r\n6 -  Nossos Médicos: \r\n7 -  Nossos convênios / Particular \r\n\r\nSair - Encerrar o atendimento\r\nMenu principal -Retornar ao menu principal','4','2020-11-16 17:19:35',18,'','texto'),(97,'1','*Agendamento de consultas por telefone*\r\n\r\nNosso telefone é *(19) 3437-5353*, contamos com uma central de agendamento das  07h às 19h, de segunda a sexta-feira, e aos sábados das 07h às 12h.\r\n\r\nCaso deseje entrar em contato direto com departamentos dentro do Hospital de Olhos Piracicaba, siga o menu apresentado no início da ligação, neste caso nos períodos entre 10h ao 12h e 15h as 17h, são os melhores para conseguir contato devido ao fluxo de pacientes do Hospital.','4','2020-11-16 17:21:29',18,'','texto'),(98,'2','*Agendamento de consultas pelo site*\r\n\r\nClick a seguir www.holhospiracicaba.com.br.\r\nNo site você consegue ter acesso a grade de atendimento dos médicos e escolher o horário de maneira fácil e intuitiva. Funciona 24 horas.','4','2020-11-16 17:23:35',18,'','texto'),(99,'3','*Localização do Hospital de Olhos Piracicaba *\r\n\r\nRua São Joao 1232, Bairro Alto Piracicaba São Paulo CEP:13416-585 \r\n\r\nClick no link para visualizar o mapa: https://goo.gl/maps/aXJqhsXB2sSxS6NPA','4','2020-11-16 17:24:46',18,'','texto'),(100,'inicio_atendimento','Olá, é um prazer atender você!\r\n\r\n*Para começar, preciso saber seu nome:*','1','2020-12-09 10:31:08',20,NULL,'texto'),(101,'menu_principal','Obrigado por responder.\r\nSou o atendente virtual da Zapbot. Vou oferecer algumas opções abaixo para te ajudar:\r\n\r\nDigite o número referente a sua necessidade:\r\n1 - Conhecer o Zapbot\r\n2 - Contratar o Zapbot\r\n3 - Falar agora com um consultor\r\n4 - Quero enviar meu produto para assistência técnica\r\n\r\nA qualquer momento, digite SAIR para finalizar o atendimento','2','2020-12-09 10:31:08',20,NULL,'texto'),(102,'menu_invalido','Infelizmente não identifiquei sua solicitação.\r\nClique no link abaixo e fale agora com um consultor:\r\n\r\nwa.me/5531985294349','3','2020-12-09 10:31:08',20,NULL,'texto'),(103,'fim_atendimento','Obrigado por entrar em contato. ','5','2020-12-09 10:31:08',20,NULL,'texto'),(104,'1','Automatize seu whatsapp. Converse com vários clientes de forma unificada.\r\nEnvie mensagens automatizadas e tenha um robo para atendimento.\r\n\r\n*Utilize o whtasapp de forma profissional*\r\nCrie campanhas, dispare em massa para seus clientes e aumente suas vendas.\r\n\r\n- Crie grupos de envio;\r\n- Importe contatos através do excel;\r\n- Envie mensagens via whatsapp de forma automatizada\r\n- Ative o Robô para atendimento automático\r\n- Fidelize seu cliente e conquiste novos utilizando a ferramenta que mais converte no mercado.\r