INSERT INTO `campanhas` VALUES (15,'2020-09-10 00:39:24',NULL,'Campanha Vereador','1599698362611campanha_91.jpg','Boa Noite! Gostaria de apresentar uma nova ferramenta para envio de whatsapp em massa.','imagem',1),(16,'2020-09-10 00:51:37',NULL,'Campanha Teste','1599699091402postagem_600.png','Conheça o zapbot! Sistema para envio de mensagens em massa para whatsapp.','imagem',1),(17,'2020-09-10 21:07:24',NULL,'teste','1599772044759coletamos.jpg','lasdkljf asld kj','imagem',1),(25,'2020-10-01 11:20:53',NULL,'Campanha Levapramim','16015512528183750196.jpg','Precisa transportar sua geladeira, sofá ou cama? Obtenha carretos com um clique! Acesse: www.levapramimapp.com.br e baixe nosso aplicativo.','imagem',4),(26,'2020-10-01 11:24:51',NULL,'Texto valdeci','1601551491151','Bom Dia, aqui é o Valdeci tudo bem? Você deve estar em minha lista de contatos. Gostaria de apresentar uma ferramenta que desenvolvi. Ela envia mensagens de forma automática através do whatsapp. Faça um teste por 7 dias em custo. Me chame aqui que eu te mostro blz? https://wa.me/553141030592. Abraço!','',4),(27,'2020-10-01 18:55:53',NULL,'Campanha sem texto','1601578553393','asd aasd as dfasdf asdf asdfa sdf asf','',4),(28,'2020-10-01 23:00:15',NULL,'banho de espuma','1601593213075flyer_novo.jpg','Na troca de óleo, Ganhe 40% de desconto na ducha simples ','imagem',4),(29,'2020-10-08 11:34:08',NULL,'Clientes Vision Tech','1602156848632','Olá, Sou o Raphael Maia, trabalho na Mediphacos. *Estamos com condições especiais no mês de Outubro* e gostaríamos de apresentar uma proposta comercial de lentes intraoculares. Você seria a pessoa responsável pela compra de insumos para cirurgias de catarata? Caso não, poderia me indicar?','',7),(30,'2020-10-15 23:06:46',NULL,'Clientes Visita Não Compraram','1602803198571Apresentação do Live Up.pdf','Conheça o mais novo empreendimento da região do Nova Suiça. Live Up. Empreendimento de alto padrão','documento',10),(31,'2020-10-15 23:13:56',NULL,'Clientes Visita Não Comp