\r\n\r\nJá fizemos o serviço para vários cartórios em Minas Gerais. Em decorrência do provimento 88, vários cartórios estão se adequando no que tange a digitalização dos livros e fichas de assinaturas. \r\n\r\nGostaria de fazer um orçamento sem compromisso, podemos conversar sobre?','',3),(58,'2020-11-10 13:25:11',NULL,'Aniversariantes 10.11','1605014711463','Olá,\r\n\r\nNós, da Clínica Oftalmológica Dra. Smantje Schwabe, desejamos a você Feliz Aniversário !\r\n\r\nQue esta data seja repleta de alegria e confraternização.\r\n\r\nFelicidades!\r\n\r\nClínica Oftalmológica\r\nDra. Smantje Schwabe\r\n','',17),(59,'2020-11-13 11:05:43',NULL,'Pacote','1605265543510','Olá, Sou o Raphael Maia, seu consultor na Mediphacos. \r\n\r\n*Estamos com condições especiais no mês de Novembro* e gostaríamos de apresentar nosso novo pacote para compra de produtos onde você pode ter até _25% de desconto nas compras._\r\n\r\nMe chama aqui que explico como funciona ok? Excelente fim de semana para você!','',7),(60,'2020-12-04 18:24:49',NULL,'LGPD','1607106289329','Olá,\r\n\r\nHoje eu te chamei pra tratar de um assunto bem importante.\r\n\r\nEntão, quero muito seguir falando com você, para me contar como e por onde acha melhor receber minhas mensagens, é só tocar nesse link http://lgpd.zapatendimento.com.br/\r\n\r\nVocê vai receber uma resposta de retorno das suas escolhas aqui pelo whatsapp.','',3),(61,'2020-12-04 18:26:59',NULL,'Consulta 1 ano','1607106419262','Olá, \r\n\r\nVocê sabia que é recomendado pela Sociedade Brasileira de Oftalmologia que o seu retorno ao \r\nOftalmologista seja realizado após um ano? \r\n\r\nNotamos que sua consulta já está no momento certo para agendamento. Nós da Cerpo\r\nestamos com horários exclusivos para pacientes especiais como você.  \r\n\r\nAproveite e conheça nossos novos protocolos de higienização e nova dinâmica de marcação de consultas. \r\n\r\nAgende agora pelo link:\r\n http://wa.me/553141030592','',3),(62,'2020-12-04 20:58:48',NULL,'VARILUX EM DOBRO','1607115528003varilux em dobro.png','Que tal fazer um par de lentes multifocais Varilux (com Crizal e/ou Transitions) e ganhar outro par inteiramente grátis?!\r\n\r\nOu você pode optar por ganhar um par de lentes ocupacionais (intermediário e perto - Varilux Digitime em resina sem AR) para trabalhar no computador com mais conforto...\r\n\r\nNa compra de uma lente Varilux X nós pagamos sua corrida! IDA E VOLTA (No valor máximo de R$100,00)\r\n\r\nAproveite essa chance e tenha óculos reservas, solares ou ocupacionais com seu grau atualizado!\r\n\r\nPara garantir o seu desconto, informe o Código #ClubePrime no momento da sua compra!\r\n\r\nSegue contato para orçamentos e dúvidas: (21) 9 9696-0077','imagem',19),(63,'2020-12-07 12:59:29',NULL,'Campanha Intraocular Valdeci','1607345969779','Olá, \r\n\r\nSou o Valdeci Alves, trabalho na Mediphacos.\r\n\r\n *Estamos com condições especiais no mês de Dezembro* e gostaríamos de apresentar uma proposta comercial de lentes intraoculares. \r\n\r\nEstá precisando de alguma cotação no momento? Temos lentes para pronta entrega.','',7),(65,'2020-12-07 13:45:05',NULL,'Campanha Varilux + Blue UV','1607348705387Varilux + Blue UV 1 (1).png','Olá!\r\n\r\nTem campanha nova rolando para os clientes do Laboratório Prime Optical:\r\n\r\n*Varilux 360º + Blue UV Grátis*\r\n\r\nEntre em contato com nosso equipe de consultores e saiba mais sobre esta promoção!\r\n\r\n- Varilux 360º + Blue UV grátis é cumulativa com Varilux em Dobro;\r\n- Varilux 360º + Blue UV grátis NÃO é cumulativa com Meu Primeiro Varilux;\r\n- Material Orma NÃO participa da promoção, pois, não possui opção Blue UV.','imagem',15),(72,'2020-12-10 19:09:25',NULL,'Pacientes 1 ano','1607627365601','Olá,\r\n\r\nVocê sabia que é recomendado pela Sociedade Brasileira de Oftalmologia que o seu retorno ao Oftalmologista seja realizado após um ano? \r\n\r\nNotamos que sua consulta já está no momento certo para agendamento. Estamos com horários exclusivos para pacientes especiais c