a Varilux!\r\n\r\nA promoção Meu Primeiro Varilux oferece 50% de desconto em lentes multifocais Varilux combinadas com as tecnologias Crizal®, Transitions® ou Xperio®. \r\n\r\nFaça o seu cadastro no site da Varilux e receba o desconto! ','imagem',19),(103,'2020-12-28 20:33:33',NULL,'Novos hábitos para óticas pós pandemia!','1609187613051E-book Gratuito_ Novos hábitos para ópticas  pós pandemia! 1 (3).png','Olá!\r\n\r\nVivemos um ano atípico, não é mesmo? Por isso, precisamos nos adaptar aos novos tempos, pois, em 2021, nada mais será como antes!\r\n\r\nPara lhe ajudar, criamos um E-BOOK GRATUITO com \"dicas de novos hábitos para a sua ótica pós pandemia\".\r\n\r\nLink para Download Gratuito: \r\nhttps://dicas.primeoptical.com.br/e-book-novos-habitos-para-opticas-pos-pandemia','imagem',15),(104,'2020-12-29 14:31:51',NULL,'LENTES KODAK PROMOÇÃO DOSE DUPLA','1609252311147POST_REDE_SOCIAL_LENTES_KODAK_PROMOÇÃO_DOSE_DUPLA_(1).png','Na compra das Lentes KODAK, você escolhe o que quer ganhar: 2º par de graça ou até 50% de desconto na próxima compra das Lentes KODAK pra quem você quiser*. \r\n\r\nVisite seu oftalmologista regularmente e venha até a nossa loja com a receita\r\nem mãos. \r\n\r\nCompre um par de Lentes KODAK participante da promoção e escolha o seu benefício!','imagem',19),(105,'2020-12-29 18:11:25',NULL,'Retorno','1609265485173','Olá {nome}, boa tarde!\r\n\r\nSou Fernando Bernini do Socila José Cândido e percebi que você não nos visita há algum tempo.\r\n\r\nVocê foi bem atendida na sua última visita?','',6),(106,'2020-12-29 21:47:48',NULL,'teste','16092784568112020.12.17-20.01.mp4','sdfasdfsd','video',27),(107,'2020-12-30 16:17:38',NULL,'aviso','1609345058255','{nome} Boa tarde!\r\n\r\nEnviamos há pouco, em seu email, arquivo com o rateio de pacotes de sua franquia  do mês de novembro de 2020.\r\n\r\nEnviamos do email envio@salaosocila.com.br e pedimos que cheque em sua caixa de SPAM.\r\n\r\nQualquer dúvida, conte conosco.','',6),(108,'2020-12-30 18:21:53',NULL,'PsquisaGoog','1609352513045','{nome}, boa tarde!\r\n\r\nO \"Google Meu Negócio\" vem se firmando como uma das melhores plataformas de conexão entre cliente e empresa. \r\n\r\nPara nos nortear na definição de estratégias para melhorar o resultado das franquias nesta plataforma, criamos um formulário para que você possa responder com as informações da sua franquia.\r\n\r\nSão somente 7 perguntas e nos ajudará bastante:\r\n\r\nhttps://forms.gle/5QkXPwhM9seyX43ZA\r\n\r\nContamos com sua resposta e qualquer dúvida, conte conosco.','',6),(111,'2021-01-05 12:18:08',NULL,'Promoções Prorrogadas - Essilor','1609849087064Promoções Prorrogadas - Essilor.mp4','As nossas *promoções* continuam a todo vapor até *30 de junho de 2021*!\r\n\r\nAproveite para continuar oferecendo as melhores promoções para os seus clientes!\r\n\r\n*- Varilux em Dobro*\r\n*- Meu Primeiro Varilux*\r\n*- Crizal em Dobro*','video',15);
